import React from "react";
import Sidenav from "./Navigation/Sidenav";
import Timeline from "./Timeline/Timeline";
import "./HomePage.css";

const HomePage=()=>{
return(
    <>
    <div className="homepage">
        <div className="homepage_nav" style={{background:"red"}}>
            <Sidenav/>
        </div>
        <div className="homepage_timeline" style={{background:"pink"}}>
            <Timeline/>
        </div>
    </div>
    </>
);
    

}

export default HomePage;
